var pubApp = pubApp || {};

pubApp.initFSizeTrigger = function()
{
    pubApp.fSizeApp = pubApp.fSizeApp || {};
    pubApp.fSizeApp.$view = pubApp.$body.find(".templateCss");
    pubApp.fSizeApp.$bigCtrl = pubApp.$body.find(".plusIcon");
    pubApp.fSizeApp.$smallCtrl = pubApp.$body.find(".minusIcon");
    pubApp.fSizeApp.$all = $( pubApp.fSizeApp.$view[0].querySelectorAll("*") );
    pubApp.fSizeApp.limitCount = 4;
	pubApp.fSizeApp.$smallCtrl.css("opacity", .4);

    pubApp.fSizeApp.$bigCtrl.on("click", function() {resizeText(1);});
    pubApp.fSizeApp.$smallCtrl.on("click", function() {resizeText(-1);});


    m4thUtil.IndexManager.add({ id : "resizeFontSize", len : pubApp.fSizeApp.limitCount , isNext : false });
    pubApp.fSizeApp.$all.each( function(idx){
        var $this = $(this);
        $this.attr( { "data-size" : $this.css("font-size") , "data-default-size" : $this.css("font-size"), "data-idx" : idx } );
    });

    function resizeText( addedSize )
    {
        var currentIdx = m4thUtil.IndexManager.find("resizeFontSize").getIndex();
        var idx = m4thUtil.IndexManager.find("resizeFontSize").getIndex( addedSize );
        pubApp.fSizeApp.$bigCtrl.css("opacity", 1 );
        pubApp.fSizeApp.$smallCtrl.css("opacity", 1 );
        if( currentIdx+addedSize >= pubApp.fSizeApp.limitCount || currentIdx+addedSize <= 0){
            var $elem = ( idx > 0 ) ? pubApp.fSizeApp.$bigCtrl : pubApp.fSizeApp.$smallCtrl;
            $elem.css("opacity", .4 );
        }
        if( currentIdx+addedSize > pubApp.fSizeApp.limitCount || currentIdx+addedSize < 0) return;

        pubApp.fSizeApp.$all.each( function(idx){
            var $this = $(this),	ftSize = parseInt( $this.attr("data-size") ) + addedSize;
			var _display = $this.attr("style");
			
			if( _display === undefined ) _display = "";
			if( $this[0].nodeName !== "IFRAME" )
			{
				$this.attr('style', _display+ " font-size : "+ ftSize+"px !important;");
				$this.attr("data-size", ftSize);
			}
			
        });
    }
}

